%% Run Simulation

% Main loop
for k = 0:length(0:dt:tf)
    currentTime = tLog(k+1);
    % Does not preserve magnitude
    R_P2I = principal2Inertial(x(1:4));
    [V,M,measW]=generateMeasurementMatrix(x,currentTime,R_P2I);

    % Determine the desired attitude
    qDesired=desiredAttitude(pointingPrincipal,x(8:10)',x(1:4)');

    % u: input, [tx; ty; tz; fx; fy; fz]
    gravityGradientTorque = gravityGradient(I_principal,x,R_P2I);
    magneticTorque = magneticTorques(x, currentTime);
    solarTorque = solarTorques(x, geometryPrincipalFrame);
    aeroTorque = aeroTorques(x, geometryPrincipalFrame);

    % Attitude estimation

    [attitudeEstimateDet,~]=deterministicAttitude(M,V);
    %attitudeEstimateDet=quaternionSign(x(1:4),attitudeEstimateDet);
    [attitudeEstimateStat,~]=qmethod(M,V,measW);
    %attitudeEstimateStat=quaternionSign(x(1:4),attitudeEstimateStat);
    [attitudeErr,~]=attitudeError(attitudeEstimateDet,x(1:4));


    % Total torque acting on the satellite
    u(1:3) = gravityGradientTorque + magneticTorque + solarTorque + aeroTorque;


    % Update the log
    gravityTorqueLog(:,k+1) = norm(gravityGradientTorque);
    magneticTorqueLog(:,k+1) = norm(magneticTorque);
    solarTorqueLog(:,k+1) = norm(solarTorque);
    aeroTorqueLog(:,k+1) = norm(aeroTorque);

    % Onboard Estimate
    attitudeErrorLog(:,k+1) =attitudeErr;
    sunVectorLog(:,k+1)=M(:,1);
    magVectorLog(:,k+1)=M(:,2);
    attitudeEstimateLog(:,k+1) = attitudeEstimateDet;


    % EKF Attitude estimation
    [xNew, y] = fDiscreteRK4(x, u, currentTime, dt);
    [meanPredict, covPredict, meanNew, covNew] = EKF(x, u, y, mean, cov, Q, R, dt, currentTime);


    % Store the results
    uLog(:,k+1) = u;
    xLog(:,k+1) = x;
    ylog(:,k+1) = y;


    mean = meanNew;
    cov = covNew;
    x=xNew;



end


%% functions


function xDot = fContinuous(x, u)
    % Returns the nonlinear continuous-time derivative, x_dot = f(x, u)
    
    % Inputs:
    % x: state, [q0; q1; q2; q3; wx; wy; wz; px; py; pz; vx; vy; vz]
    % u: input, [tx; ty; tz; fx; fy; fz]
    
    % Outputs:
    % xDot

    q0 = x(1);
    q1 = x(2);
    q2 = x(3);
    q3 = x(4);

    wx = x(5);
    wy = x(6);
    wz = x(7);

    px = x(8);
    py = x(9);
    pz = x(10);

    vx = x(11);
    vy = x(12);
    vz = x(13);

    tx = u(1);
    ty = u(2);
    tz = u(3);
    fx = u(4);
    fy = u(5);
    fz = u(6);

    % parameters
    Ixx = 1.0e+03 * 0.230242103134935;
    Iyy = 1.0e+03 * 5.293968876196306;
    Izz = 1.0e+03 * 5.518363350668759;
    m = 260;
    mu = 3.986004418e14;
    % Reaction Wheel
    IwheelZ=0;
    wWheel=0;
    % Direction of the Wheel principal axis
    rx=0;
    ry=0;
    rz=0;

    xDot = [-0.5000*q1*wx - 0.5000*q2*wy - 0.5000*q3*wz;
             0.5000*q0*wx - 0.5000*q3*wy + 0.5000*q2*wz;
             0.5000*q3*wx + 0.5000*q0*wy - 0.5000*q1*wz;
             0.5000*q1*wy - 0.5000*q2*wx + 0.5000*q0*wz;
           (tx - (Izz-Iyy)*wy*wz+IwheelZ*wWheel*(wy*rz-wz*ry))/Ixx;
           (ty - (Ixx-Izz)*wz*wx+IwheelZ*wWheel*(wz*rx-wx*rz))/Iyy;
           (tz - (Iyy-Ixx)*wx*wy+IwheelZ*wWheel*(wx*ry-wy*rx))/Izz;
             vx*(q0^2 + q1^2 - q2^2 - q3^2) - vy*(2*q0*q3 - 2*q1*q2) + vz*(2*q0*q2 + 2*q1*q3);
             vy*(q0^2 - q1^2 + q2^2 - q3^2) + vx*(2*q0*q3 + 2*q1*q2) - vz*(2*q0*q1 - 2*q2*q3);
             vz*(q0^2 - q1^2 - q2^2 + q3^2) - vx*(2*q0*q2 - 2*q1*q3) + vy*(2*q0*q1 + 2*q2*q3);
            (fx + m*vy*wz - m*vz*wy - (m*mu*px*(q0^2 + q1^2 - q2^2 - q3^2))/(px^2 + py^2 + pz^2)^1.5 - (m*mu*py*(2*q0*q3 + 2*q1*q2))/(px^2 + py^2 + pz^2)^1.5 + (m*mu*pz*(2*q0*q2 - 2*q1*q3))/(px^2 + py^2 + pz^2)^1.5)/m;
            (fy - m*vx*wz + m*vz*wx - (m*mu*py*(q0^2 - q1^2 + q2^2 - q3^2))/(px^2 + py^2 + pz^2)^1.5 + (m*mu*px*(2*q0*q3 - 2*q1*q2))/(px^2 + py^2 + pz^2)^1.5 - (m*mu*pz*(2*q0*q1 + 2*q2*q3))/(px^2 + py^2 + pz^2)^1.5)/m;
            (fz + m*vx*wy - m*vy*wx - (m*mu*pz*(q0^2 - q1^2 - q2^2 + q3^2))/(px^2 + py^2 + pz^2)^1.5 - (m*mu*px*(2*q0*q2 + 2*q1*q3))/(px^2 + py^2 + pz^2)^1.5 + (m*mu*py*(2*q0*q1 - 2*q2*q3))/(px^2 + py^2 + pz^2)^1.5)/m];

end

function [meanPredict, covPredict, meanUpdate, covUpdate] = EKF(x, u, y, mean, cov, Q, R, dt, t)
    
    q0 = mean(1);
    q1 = mean(2);
    q2 = mean(3);
    q3 = mean(4);
    wx = mean(5);
    wy = mean(6);
    wz = mean(7);

    px = x(8);
    py = x(9);
    pz = x(10);
    vx = x(11);
    vy = x(12);
    vz = x(13);

    tx = u(1);
    ty = u(2);
    tz = u(3);
    fx = u(4);
    fy = u(5);
    fz = u(6);

    % parameters
    Ixx = 1.0e+03 * 0.230242103134935;
    Iyy = 1.0e+03 * 5.293968876196306;
    Izz = 1.0e+03 * 5.518363350668759;
    m = 260;
    mu = 3.986004418e14;
    
    A = [1, -0.5*dt*wx, -0.5*dt*wy, -0.5*dt*wz,   -0.5*dt*q1,  -0.5*dt*q2,   -0.5*dt*q3;
         0.5*dt*wx, 1,  0.5*dt*wz, -0.5*dt*wy,    0.5*dt*q0,  -0.5*dt*q3,    0.5*dt*q2;
         0.5*dt*wy, -0.5*dt*wz, 1,  0.5*dt*wx,    0.5*dt*q3,   0.5*dt*q0,   -0.5*dt*q1;
         0.5*dt*wz,  0.5*dt*wy, -0.5*dt*wx, 1,   -0.5*dt*q2,   0.5*dt*q1,    0.5*dt*q0;
         0, 0, 0, 0,   1, (dt*(Iyy*wz - Izz*wz))/Ixx,  (dt*(Iyy*wy - Izz*wy))/Ixx;
         0, 0, 0, 0, -(dt*(Ixx*wz - Izz*wz))/Iyy,  1, -(dt*(Ixx*wx - Izz*wx))/Iyy;
         0, 0, 0, 0,  (dt*(Ixx*wy - Iyy*wy))/Izz, (dt*(Ixx*wx - Iyy*wx))/Izz,   1];

    f_discrete = [q0 - dt*(0.5*q1*wx + 0.5*q2*wy + 0.5*q3*wz);
                  q1 + dt*(0.5*q0*wx - 0.5*q3*wy + 0.5*q2*wz);
                  q2 + dt*(0.5*q3*wx + 0.5*q0*wy - 0.5*q1*wz);
                  q3 + dt*(0.5*q1*wy - 0.5*q2*wx + 0.5*q0*wz);
                  wx + (dt*(tx + Iyy*wy*wz - Izz*wy*wz))/Ixx;
                  wy + (dt*(ty - Ixx*wx*wz + Izz*wx*wz))/Iyy;
                  wz + (dt*(tz + Ixx*wx*wy - Iyy*wx*wy))/Izz];
    
    f_discrete(1:4) = f_discrete(1:4)./norm(f_discrete(1:4)); % normalize quaternion
    
    % predict -------------------------------------------------------------
    meanPredict = f_discrete;
    covPredict = A*cov*A' + Q;

    % update --------------------------------------------------------------
    q0 = meanPredict(1);
    q1 = meanPredict(2);
    q2 = meanPredict(3);
    q3 = meanPredict(4);
    wx = meanPredict(5);
    wy = meanPredict(6);
    wz = meanPredict(7);

    g = [wx;    % gyro
         wy;
         wz;
         q2^2 - q1^2 - q0^2 + q3^2; % sun sensor
         2*q0*q3 - 2*q1*q2;
        -2*q0*q2 - 2*q1*q3;   
      -((2.3960e-05*cos(0.0011*t)*(0.1220*cos(7.2900e-05*t) - 0.7820) + 4.8587e-06*sin(0.0011*t)*sin(7.2900e-05*t))*(px*q0^2 + px*q1^2 - px*q2^2 - px*q3^2 + 2*py*q0*q3 + 2*py*q1*q2 - 2*pz*q0*q2 + 2*pz*q1*q3))/(px^2 + py^2 + pz^2)^0.5 - ((3.8803e-06*cos(7.2900e-05*t) + 1.4120e-05)*(py^2*q0^4*vx + py^2*q1^4*vx + py^2*q2^4*vx + py^2*q3^4*vx + pz^2*q0^4*vx + pz^2*q1^4*vx + pz^2*q2^4*vx + pz^2*q3^4*vx + 4*px^2*q0^2*q2^2*vx + 4*px^2*q0^2*q3^2*vx + 4*px^2*q1^2*q2^2*vx + 4*px^2*q1^2*q3^2*vx + 2*py^2*q0^2*q1^2*vx + 2*py^2*q0^2*q2^2*vx - 2*py^2*q0^2*q3^2*vx - 2*py^2*q1^2*q2^2*vx + 2*py^2*q1^2*q3^2*vx + 2*py^2*q2^2*q3^2*vx + 2*pz^2*q0^2*q1^2*vx - 2*pz^2*q0^2*q2^2*vx + 2*pz^2*q0^2*q3^2*vx + 2*pz^2*q1^2*q2^2*vx - 2*pz^2*q1^2*q3^2*vx + 2*pz^2*q2^2*q3^2*vx - px*py*q0^4*vy + px*py*q1^4*vy + px*py*q2^4*vy - px*py*q3^4*vy - px*pz*q0^4*vz + px*pz*q1^4*vz - px*pz*q2^4*vz + px*pz*q3^4*vz - 2*px^2*q0*q3^3*vy + 2*px^2*q1*q2^3*vy + 2*px^2*q0^3*q3*vy - 2*px^2*q1^3*q2*vy + 2*px^2*q0*q2^3*vz - 2*px^2*q0^3*q2*vz + 2*py^2*q0*q3^3*vy - 2*py^2*q1*q2^3*vy - 2*py^2*q0^3*q3*vy + 2*py^2*q1^3*q2*vy + 2*px^2*q1*q3^3*vz - 2*px^2*q1^3*q3*vz - 2*pz^2*q0*q2^3*vz + 2*pz^2*q0^3*q2*vz - 2*pz^2*q1*q3^3*vz + 2*pz^2*q1^3*q3*vz + 4*px*py*q0*q3^3*vx + 4*px*py*q1*q2^3*vx - 4*px*py*q0^3*q3*vx - 4*px*py*q1^3*q2*vx - 4*px*pz*q0*q2^3*vx + 4*px*pz*q0^3*q2*vx + 4*px*pz*q1*q3^3*vx - 4*px*pz*q1^3*q3*vx + 2*px*py*q0*q1^3*vz + 2*px*py*q0^3*q1*vz - 2*px*pz*q0*q1^3*vy - 2*px*pz*q0^3*q1*vy + 2*px*py*q2*q3^3*vz + 2*px*py*q2^3*q3*vz + 2*px*pz*q2*q3^3*vy + 2*px*pz*q2^3*q3*vy + 2*py*pz*q0*q2^3*vy + 2*py*pz*q0^3*q2*vy + 2*py*pz*q1*q3^3*vy + 2*py*pz*q1^3*q3*vy - 2*py*pz*q0*q3^3*vz + 2*py*pz*q1*q2^3*vz - 2*py*pz*q0^3*q3*vz + 2*py*pz*q1^3*q2*vz + 6*px*py*q0^2*q3^2*vy - 6*px*py*q1^2*q2^2*vy + 6*px*pz*q0^2*q2^2*vz - 6*px*pz*q1^2*q3^2*vz - 2*px^2*q0^2*q1*q2*vy + 2*px^2*q0*q1^2*q3*vy - 2*px^2*q0*q2^2*q3*vy + 2*px^2*q1*q2*q3^2*vy - 2*px^2*q0*q1^2*q2*vz - 2*py^2*q0^2*q1*q2*vy - 2*px^2*q0^2*q1*q3*vz + 2*py^2*q0*q1^2*q3*vy + 2*px^2*q0*q2*q3^2*